import { useState } from "react";
import { Outlet, Link } from "react-router";

function Footer() {
  return (
    <footer className="w-full mt-14">
      <div className="w-full px-[6%]">
        <FooterLink />
      </div>
    </footer>
  );
}

function FooterLink() {
  const [Link, SetLink] = useState([
    {
      LinkName: "فرصت های شغلی",
      To: "/",
    },
    {
      LinkName: "بلاگ",
      To: "/",
    },
    {
      LinkName: "باشگاه رانندگان",
      To: "/",
    },
    {
      LinkName: "ثبت نام راننده اسنپ",
      To: "/",
    },
    {
      LinkName: "پنل سازمانی",
      To: "/",
    },
    {
      LinkName: "درباره ما",
      To: "/About",
    },
    {
      LinkName: "تماس با ما",
      To: "/",
    },
  ]);
  return (
    <div className="w-full">
      <ul className="w-full flex">
        {Link.map((val, index) => {
          return (
            <li
              className="flex items-center justify-center text-right grow"
              key={index}
            >
              <Link
                to={val.To}
                className="text-[#1e1e1e] w-fit duration-700 ease-out hover:text-[#21AA58]"
              >
                {val.LinkName}
              </Link>
            </li>
          );
        })}
      </ul>
      <Outlet />
    </div>
  );
}

export default Footer;
